def build_courses(l):
	dic = {}
	for i in l:
		course_code = i[0]
		course_name = i[1]
		dic[course_code] = course_name
	return dic

def build_students(l):
	dic = {}
	for i in l:
		roll = i[0]
		name = i[1]
		dic[roll] = name
	return dic

def build_grades(l):
	dic = {}
	for i in l:
		roll = i[0]
		c_code = i[1]
		grade = i[2]
		if roll in dic:
			v = dic[roll]
			v.append((c_code, grade))
			dic[roll] = v
		else:
			dic[roll] = [(c_code, grade)]
	return dic


