def transcripts(c,s,l):
	courses_dic = build_courses(c)
	studs_dic = build_students(s)
	grades = build_grades(l)

	# print(courses_dic)
	# print(studs_dic)
	# print(grades)

	final_list = []
	final_dic = {}
	for roll in studs_dic.keys():
		name = studs_dic[roll]
		courses = grades[roll]

		for c_and_g in courses:
			c_code = c_and_g[0]
			c_grade = c_and_g[1]
			c_name = courses_dic[c_code]
			t = (roll, name, [(c_code, c_name, c_grade)])

			if roll not in final_dic:
				final_dic[roll] = (name, [(c_code, c_name, c_grade)])
			else:
				v = final_dic[roll]
				v[1].append((c_code, c_name, c_grade)) 

	for key in sorted(final_dic.keys()):
		roll = key
		name = final_dic[roll][0]
		lis = final_dic[roll][1]
		final_list.append((roll, name, lis))
	for k in final_list:
		lis = k[2]
		lis = lis.sort(key = lambda a:a[0])
	return final_list


